import './App.css';
import data from './input.json';

function App() {
  const textRender = (text) => {
    return (
      <span> {text} </span>
    )
  }
  const elementRender = (type, title, children, color) => {
    console.log(color);
    if (type === 'block') {
      return (
        <div id={title} style={{color: "red"}}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </div>
      )
    }
    else if (type === 'h1') {
       return (
        <h1 id={title}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </h1>
      )   
    }
    else if (type === 'p') {
      return (
        <p id={title}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </p>
      )
    }
    else if(type === 'h4') {
      return (
        <h4 id={title}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </h4>
      )
    }
    else if(type === 'ul') {
      return (
        <ul id={title}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </ul>
      )
    }
    else if(type === 'li') {
      return (
        <li id={title}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </li>
      )
    }
    else if(type === 'lic') {
      return (
        <lic id={title}>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </lic>
      )
    }
    else {
       return (
        <span>
        {children !== undefined && children.map((child) => (
          renderJson(child)
        ))}
        </span>
      )
    } 
  }
  const renderJson = element => {
    if (element.type !== undefined) {
      return (
        elementRender(element.type, element.title, element.children, element.color)
      )
    } else {
      return (
        textRender(element.text)
      )
    }
  }
  return (
      <div>
        {data.map((element) => (
          renderJson(element)
        ))}
      </div>
  );
}

export default App;
